class MyHandler(http.server.SimpleHTTPRequestHandler):
    def do_POST(self):
        if self.path == '/api/datasync':
            self.handle_datasync()
        elif self.path == '/api/eventsync':
            self.handle_eventsync()
        elif self.path == '/api/statussync':
            self.handle_statussync()
        elif self.path == '/api/firecancel':
            self.handle_firecancel()
        elif self.path == '/api/dooropen':  # 新增远程开门接口
            self.handle_dooropen()
        else:
            self.send_error(404, "File not found")

    def handle_dooropen(self):
        self.send_response(200)
        self.send_header("Content-type", "application/json")
        self.end_headers()
        self.wfile.write(json.dumps({"retcode":200}).encode())
    def handle_datasync(self):
        self.send_response(200)
        self.send_header("Content-type", "application/json")
        self.end_headers()
        self.wfile.write(json.dumps({"retcode":200}).encode())

    def handle_eventsync(self):
        self.send_response(200)
        self.send_header("Content-type", "application/json")
        self.end_headers()
        self.wfile.write(json.dumps(JSON_even_Data).encode())

    def handle_statussync(self):
        self.send_response(200)
        self.send_header("Content-type", "application/json")
        self.end_headers()
        self.wfile.write(json.dumps(JSON_statussync_Data).encode())
    def handle_firecancel(self):
        self.send_response(200)
        self.send_header("Content-type", "application/json")
        self.end_headers()
        self.wfile.write(json.dumps({"retcode":200}).encode())

def run():
    Handler = MyHandler

    with socketserver.TCPServer(("", PORT), Handler) as httpd:
        print(f"Serving at port {PORT}")
        httpd.serve_forever()

if __name__ == '__main__':
    run()
